import React from "react";
import QA from "./QA";
import { faqDetails } from "./FAQDetails.js";

const faqList = faqDetails.map((item) => (
  <QA question={item.question} answer={item.answer} />
));

function FAQ() {
  return (
    <div>
      <Container className="outerContainer" style={{ marginBottom: "3rem" }}>
        <div className="innerContainer">
          <div id="faq">
            <div className="container">
              <h1 style={{ marginBottom: "2rem" }}>
                In case you're wondering (FAQs)
              </h1>
              {faqList}
            </div>
          </div>
        </div>
      </Container>
    </div>
  );
}

export default FAQ;
